import React from 'react';
import {
    BrowserRouter as Router,
    Route
} from "react-router-dom";

import Home from './pages/home/home';
import Kinenav from "./components/kinenav/kinenav";

function App() {
    return (
        <Router>
            <div>
                <Kinenav/>
                <Route exact path="/" component={Home}/>
            </div>
        </Router>
    );
}

export default App;
